import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h5>Click on the part to explore!</h5>
      <section id="mapd">
          <div class="maph">
              <div class="map">
                  <img src="./images/decentraland_map_01.png" alt="" class="mapp" id="map1"></img>
                  <img src="./images/decentraland_map_02.gif" alt="" class="mapp" id="map2"></img>
                  <img src="./images/decentraland_map_03.gif" alt="" class="mapp" id="map3"></img>
                  <img src="images/decentraland_map_04.gif" alt="" class="mapp" id="map4"></img>
                  <img src="images/decentraland_map_05.gif" alt="" class="mapp" id="map5"></img>
                  <img src="images/decentraland_map_06.gif" alt="" class="mapp" id="map6"></img>
                  <img src="images/decentraland_map_07.gif" alt="" class="mapp" id="map7"></img>
                  <img src="images/decentraland_map_08.gif" alt="" class="mapp" id="map8"></img>
                  <img src="images/decentraland_map_09.gif" alt="" class="mapp" id="map9"></img>
              </div>
          </div>
      </section>
    </div>
  );
}

export default App;
